static void control_system_computeGradLag(emxArray_real_T_control_syste_T
  *workspace, int32_T ldA, int32_T nVar, const emxArray_real_T_control_syste_T
  *grad, int32_T mIneq, const emxArray_real_T_control_syste_T *AineqTrans, const
  emxArray_int32_T_control_syst_T *finiteFixed, int32_T mFixed, const
  emxArray_int32_T_control_syst_T *finiteLB, int32_T mLB, const
  emxArray_int32_T_control_syst_T *finiteUB, int32_T mUB, const
  emxArray_real_T_control_syste_T *lambda)
{
  int32_T b;
  int32_T iL0;
  int32_T ia;
  int32_T iac;
  int32_T ix;
  int32_T iy;
  for (ix = 0; ix < nVar; ix++) {
    workspace->data[ix] = grad->data[ix];
  }

  for (iL0 = 0; iL0 < mFixed; iL0++) {
    workspace->data[finiteFixed->data[iL0] - 1] += lambda->data[iL0];
  }

  if (mIneq != 0) {
    ix = mFixed;
    iL0 = (mIneq - 1) * ldA + 1;
    iac = 1;
    while (((ldA > 0) && (iac <= iL0)) || ((ldA < 0) && (iac >= iL0))) {
      iy = 0;
      b = (iac + nVar) - 1;
      for (ia = iac; ia <= b; ia++) {
        workspace->data[iy] += AineqTrans->data[ia - 1] * lambda->data[ix];
        iy++;
      }

      ix++;
      iac += ldA;
    }
  }

  iL0 = mFixed + mIneq;
  for (iac = 0; iac < mLB; iac++) {
    workspace->data[finiteLB->data[iac] - 1] -= lambda->data[iL0];
    iL0++;
  }

  for (iac = 0; iac < mUB; iac++) {
    workspace->data[finiteUB->data[iac] - 1] += lambda->data[iL0];
    iL0++;
  }
}

