static int32_T control_system_ixamax(int32_T n, const
  emxArray_real_T_control_syste_T *x)
{
  real_T smax;
  real_T y;
  int32_T idxmax;
  int32_T ix;
  int32_T k;
  if (n < 1) {
    idxmax = 0;
  } else {
    idxmax = 1;
    if (n > 1) {
      ix = 0;
      smax = fabs(x->data[0]);
      for (k = 2; k <= n; k++) {
        ix++;
        y = fabs(x->data[ix]);
        if (y > smax) {
          idxmax = k;
          smax = y;
        }
      }
    }
  }

  return idxmax;
}

