static real_T control__computePrimalFeasError(const real_T x[20], int32_T
  mLinIneq, int32_T mNonlinIneq, const emxArray_real_T_control_syste_T *cIneq,
  const emxArray_int32_T_control_syst_T *finiteLB, int32_T mLB, const
  emxArray_real_T_control_syste_T *lb, const emxArray_int32_T_control_syst_T
  *finiteUB, int32_T mUB, const emxArray_real_T_control_syste_T *ub)
{
  real_T feasError;
  int32_T b_idx;
  int32_T mIneq;
  feasError = 0.0;
  mIneq = mNonlinIneq + mLinIneq;
  for (b_idx = 0; b_idx < mIneq; b_idx++) {
    feasError = fmax(feasError, cIneq->data[b_idx]);
  }

  for (mIneq = 0; mIneq < mLB; mIneq++) {
    feasError = fmax(feasError, lb->data[finiteLB->data[mIneq] - 1] - x
                     [finiteLB->data[mIneq] - 1]);
  }

  for (mIneq = 0; mIneq < mUB; mIneq++) {
    feasError = fmax(feasError, x[finiteUB->data[mIneq] - 1] - ub->data
                     [finiteUB->data[mIneq] - 1]);
  }

  return feasError;
}

