static real_T control_syste_computeComplError(const
  emxArray_real_T_control_syste_T *fscales_lineq_constraint, const
  emxArray_real_T_control_syste_T *fscales_cineq_constraint, const real_T
  xCurrent[20], int32_T mIneq, const emxArray_real_T_control_syste_T *cIneq,
  const emxArray_int32_T_control_syst_T *finiteLB, int32_T mLB, const
  emxArray_real_T_control_syste_T *lb, const emxArray_int32_T_control_syst_T
  *finiteUB, int32_T mUB, const emxArray_real_T_control_syste_T *ub, const
  emxArray_real_T_control_syste_T *lambda, int32_T iL0)
{
  real_T nlpComplError;
  real_T ubDelta;
  real_T ubLambda;
  int32_T iLineq0;
  int32_T lbOffset;
  int32_T mLinIneq;
  int32_T nlpComplError_tmp;
  int32_T nlpComplError_tmp_0;
  nlpComplError = 0.0;
  mLinIneq = fscales_lineq_constraint->size[0] - 1;
  if ((mIneq + mLB) + mUB > 0) {
    for (iLineq0 = 0; iLineq0 <= mLinIneq; iLineq0++) {
      nlpComplError_tmp = (iL0 + iLineq0) - 1;
      nlpComplError = fmax(nlpComplError, fmin(fabs(lambda->
        data[nlpComplError_tmp] * cIneq->data[iLineq0]), fmin(fabs(cIneq->
        data[iLineq0]), lambda->data[nlpComplError_tmp])));
    }

    iLineq0 = (iL0 + fscales_lineq_constraint->size[0]) - 2;
    for (lbOffset = 1; lbOffset - 1 < fscales_cineq_constraint->size[0];
         lbOffset++) {
      nlpComplError_tmp = mLinIneq + lbOffset;
      nlpComplError_tmp_0 = iLineq0 + lbOffset;
      nlpComplError = fmax(nlpComplError, fmin(fabs(cIneq->
        data[nlpComplError_tmp] * lambda->data[nlpComplError_tmp_0]), fmin(fabs
        (cIneq->data[nlpComplError_tmp]), lambda->data[nlpComplError_tmp_0])));
    }

    lbOffset = (iL0 + mIneq) - 1;
    mLinIneq = lbOffset + mLB;
    for (iLineq0 = 0; iLineq0 < mLB; iLineq0++) {
      ubDelta = xCurrent[finiteLB->data[iLineq0] - 1] - lb->data[finiteLB->
        data[iLineq0] - 1];
      ubLambda = lambda->data[lbOffset + iLineq0];
      nlpComplError = fmax(nlpComplError, fmin(fabs(ubDelta * ubLambda), fmin
        (fabs(ubDelta), ubLambda)));
    }

    for (lbOffset = 0; lbOffset < mUB; lbOffset++) {
      ubDelta = ub->data[finiteUB->data[lbOffset] - 1] - xCurrent[finiteUB->
        data[lbOffset] - 1];
      ubLambda = lambda->data[mLinIneq + lbOffset];
      nlpComplError = fmax(nlpComplError, fmin(fabs(ubDelta * ubLambda), fmin
        (fabs(ubDelta), ubLambda)));
    }
  }

  return nlpComplError;
}

