/* Function for MATLAB Function: '<S13>/vehicle model' */
static void control_sy_automlvehdynftiresat(real_T Ftire_x, real_T Ftire_y,
  real_T b_Fxtire_sat, real_T b_Fytire_sat, real_T *Ftire_xs, real_T *Ftire_ys)
{
  real_T Ftire_mag;
  real_T Ftire_y_max;
  real_T c_a;
  real_T theta_Ftire;
  theta_Ftire = rt_atan2d_snf(Ftire_x, Ftire_y);
  Ftire_y_max = cos(theta_Ftire);
  Ftire_mag = b_Fxtire_sat * Ftire_y_max;
  theta_Ftire = sin(theta_Ftire);
  c_a = b_Fytire_sat * theta_Ftire;
  Ftire_mag = b_Fxtire_sat * b_Fytire_sat / sqrt(Ftire_mag * Ftire_mag + c_a *
    c_a);
  theta_Ftire *= Ftire_mag;
  Ftire_y_max *= Ftire_mag;
  *Ftire_xs = Ftire_x;
  if (fabs(Ftire_x) > fabs(theta_Ftire)) {
    *Ftire_xs = theta_Ftire;
  }

  *Ftire_ys = Ftire_y;
  if (fabs(Ftire_y) > fabs(Ftire_y_max)) {
    *Ftire_ys = Ftire_y_max;
  }
}

